import astfrom utils import *import csvimport refilepath_path_gt = 'input/gt'filepath_video_games = 'input/video_games.txt'if __name__ == '__main__':    # Read ground truth    d = read_gt(filepath_path_gt)    # Open the CSV file    with open(filepath_video_games, 'r', encoding='utf-8') as file:        # Create a CSV reader        reader = csv.DictReader(file)        # Iterate over each row in the CSV file        for row in reader:            title = row['Title']            sections_str = row['Sections']            # read the sections_str literal to a list            sections = ast.literal_eval(sections_str)            # Print the results            print(f'Title: {title}')            print(f'Sections: {sections}')            print('---')